// the Regex email validation was token from : https://emailregex.com/

export const EmailRegex =
	// eslint-disable-next-line no-useless-escape
	/^[a-zA-Z0-9.!#$%&’*+/=?^_`{|}~-]+@[a-zA-Z0-9-]+(?:\.[a-zA-Z0-9-]+)*$/;
